#include <string>
using namespace std;

int main() {
    string s;
    getline(cin, s); 

    string reversed = "";

    for (int i = s.length() - 1; i >= 0; i--) {
        reversed += s[i];
    }

    if (s == reversed) {
        cout << "Palindrome" << endl;
    } else {
        cout << "Not a palindrome" << endl;
    }

    return 0;
}

